style:
#resumecv-layout {
       width: 100%;
       max-width: 210mm;
       background: #3F9599;
       padding: 0;
         box-shadow: 0 3px 1px -2px rgba(0,0,0,.2), 0 2px 2px 0 rgba(0,0,0,.14), 0 1px 5px 0 rgba(0,0,0,.12);

   }

   #resumecv-main {
       font-size: 14px;
       line-height: 24px;
   }

   #resumecv-content {
       background: #fff;
   }

   #resumecv-content .resumecv-content-main {
       padding: 15px;
   }

   #resumecv-content-top {
       background: #fff;
       padding-bottom: 10px;
   }

   #resumecv-top-info-img {
       display: flex;
       flex-wrap: nowrap;
   }

   #resumecv-top-info-img .resumecv-top-info {
       width: 80%;
       text-align: left;
       display: block;
       margin-top: 34px;
       margin-left: 40px;
       padding-top: 25px;
       padding-left: 30px;
       color: #fff;

   }



   #resumecv-box-ava img {
       width: 150px;
       border-radius: 50%;
   }

   #resumecv-top-info-contact {
       display: flex;
       padding: 8px 30px;
       margin-top: 20px;
       margin-bottom: 0px !important;
       color: #fff;
       font-size: 14px;
       background-color: #fdcb2a;
   }

   #resumecv-top-info-contact .top-contact {
       flex: auto;
       padding: 5px;
   }

   #resumecv-content .resumecv-block {
       position: relative;
       padding: 5px 10px;
   }

   #rb-left .resumecv-box-content {
       padding-bottom: 0;
       margin: 0;
   }

   .tag {
       background-color: #fdcb2a;
       margin-right: 2px;
       margin-bottom: 5px;
       padding: .2em .6em .3em;
       font-size: 16px;
       font-weight: 500;
       color: #484a54;
       text-align: center;
       white-space: nowrap;
       vertical-align: baseline;
       display: inline-block;
       border-radius: .25em;
   }

   .skill {
       margin-top: 15px
   }

   #resumecv-content-top h1 {
       font-size: 32px;
       margin: 0;
       padding-bottom: 10px;
       /* t, r,b,l */
       line-height: normal;
       text-transform: uppercase;
       font-weight: 700;
       color: #333;

   }

   #resumecv-content-top p {
       color: #333;

   }


   #resumecv-content-top h2 {
       color: #333;
       margin: 0;
       font-size: 22px;
       font-weight: normal;
       font-style: italic;
       font-weight: 400;
   }

   .box-name p {
       overflow: hidden;
   }

   .box-name {
       overflow: hidden;
       background: #2f3a40;
   }

   #rb-left .h3 {
       font-size: 18px;
       font-weight: bold;
       margin-top: 0;
       text-transform: uppercase;

       text-align: center;
   }

   .top-contact p {
       margin: 0;
   }

   #resumecv-content .head {
       font-size: 18px;
       color: #2f3a40;
       padding-bottom: 5px;
       /* border-bottom: 2px solid #9B9C8F; */
       font-weight: bold;
       margin-top: 0;
       text-transform: uppercase;
   }


   #resumecv-content h3 {
       font-weight: bold;
       font-size: 14px;
       line-height: 30px;
       margin-bottom: 10px;
       color: #333;
   }

   #rb-left .h3 span {
       padding: 0px 15px;
   }

   #resumecv-content span {
       display: inline-block;
       padding-right: 15px;
       padding-left: 15px;
   }

   #rb-left .h3:first-child {
       margin-top: 0
   }

   .resumecv-box-content {
       margin-bottom: 25px;
       padding-left: 15px;
       position: relative;
   }

   #resumecv-box-ava {
       text-align: center;
       padding-top: 34px;
       padding-left: 40px;

   }

   .bar-exp span {
       display: block;
       height: 8px;
       background: #d9d9d9;
   }

   .bar-exp {
       background: #2f3a40;
       border: solid 2px white;
       margin-bottom: 12px;
   }

   .icoweb label {
       display: block;
       color: #627e88;
   }

   .icoweb span {
       display: block;
   }

   .box-contact {
       font-size: 13px;
       margin-left: 5px;
       padding-top: 0px;
   }

   .icoweb i.fa, .icoweb i.fab, .icoweb i.far {
       width: 20px;
       height: 20px;
       border-radius: 50%;
       -webkit-border-radius: 50%;
       -moz-border-radius: 50%;
       display: inline-block;
       text-align: center;
       font-size: 16px;
       line-height: 20px;
       color: #2f3a40 !important;
       margin-right: 10px;
       margin-top: 3px;
       float: left
   }

   .head i {
       font-size: 25px;
       margin-right: 10px;
   }

   .exp-content {
       padding-left: 15px;
   }

   #resumecv-content span.exp-date {
       float: right;
   }

   .icon_fa {
       text-align: center;
   }

   .icon_fa i.fa {
       font-size: 20px;
       border: solid 1px #ffffff;
       border-radius: 50%;
       padding: 5px;
       width: 20px;
       color: white;
       background: #ffffff;
       margin-bottom: 5px;
   }

   p.head i.fa {
       float: left
   }
